using AssemblyLib.Utils;using System;using System.Collections.Generic;using System.Collections.ObjectModel;using System.Linq;using System.Text;using System.Threading.Tasks;namespace AssemblyLib.AssemblyModels{	public class DrainInternalModel : Notifier	{		public DrainInternalModel()		{					NPS = "";			B = "";			C = "";			SupportAngle = "";			A = "";			A1 = "";			Elbow = "";		}				private string _NPS;		public string NPS			{				get { return _NPS; }				set				{					_NPS = value;					OnPropertyChanged(nameof(NPS));				}			}				private string _B;		public string B			{				get { return _B; }				set				{					_B = value;					OnPropertyChanged(nameof(B));				}			}				private string _C;		public string C			{				get { return _C; }				set				{					_C = value;					OnPropertyChanged(nameof(C));				}			}				private string _SupportAngle;		public string SupportAngle			{				get { return _SupportAngle; }				set				{					_SupportAngle = value;					OnPropertyChanged(nameof(SupportAngle));				}			}				private string _A;		public string A			{				get { return _A; }				set				{					_A = value;					OnPropertyChanged(nameof(A));				}			}				private string _A1;		public string A1			{				get { return _A1; }				set				{					_A1 = value;					OnPropertyChanged(nameof(A1));				}			}				private string _Elbow;		public string Elbow			{				get { return _Elbow; }				set				{					_Elbow = value;					OnPropertyChanged(nameof(Elbow));				}			}			}}